import { Link } from "react-router-dom";

const Session = () => {
	return (
		<div className="home">
			<h3>
				Are you a <Link to="/Login">returning</Link> user?
			</h3>
			<br />
			<h3>
				Or a <Link to="/Signup">new</Link> user?
			</h3>
		</div>
	);
};

export default Session;
